import { useState } from "react"
import React from 'react'

export default function Form() {
    var newname = '';
    const [name, setName] = useState({
        name: "",
        password: ""
    })
    const [fullname, setFullname] = useState('')
    const [pass, setPassword] = useState('')
    const [fullpass, setFullPassword] = useState('')

    const Nametext = (event) => {
        console.log(event.target.name)
        console.log(event.target.value)
        setName(event.target.value);

    }
    const Passtext = (event) => {
        console.log(event.target.value)
        setPassword(event.target.value);

    }


    const Copytext = (event) => {
        console.log(event.target.name)
        console.log(event.target.value)
        setName(event.target.value);

    }


    const Addtxt = () => {
        setFullname(name);
        setFullPassword(pass);
    }
    return (
        <>
            <div>
                <h1>Hello {fullname}  {fullpass}</h1>
                <input type='text' name='fname' onChange={Copytext} className='form-control form-control-lg' placeholder='Enter name' />
                <br /><br />
                <input type='text' name='lname' onChange={Copytext} className='form-control form-control-lg' placeholder='Enter password' />
                <br /><br />
                <button className='btn btn-primary btn-lg' onClick={Addtxt}>Click me</button>
            </div>
        </>
    )
}
